quickly runs with, promising that their new show will star lion rock legend Clay Calloway (Bono). Problem is, Buster has never met Clay, an artist who shut himself away from the world more than a decade ago after the loss of his wife. Even worse, Buster has failed to realize that Mr. Crystal is an egocentric gangster who would rather drop somebody off the roof of a building than be lied to.\n \nAs Gunter helps Buster dream up an out-of-this-world theatrical masterpiece, and the pressure (and sinister threats) from Mr. Crystal mount, Rosita‚Äôs leading role in the show gets ripped away and handed to Mr. Crystal‚Äôs spoiled daughter, Porsha, played by Grammy-nominated artist Halsey. Desperate to save the show, and his life, Buster embarks on a quest to find Clay and persuade him to return to the stage.\n \nWhat begins as a dream of big-time success becomes an emotional reminder of the power of music to heal even the most broken heart.\n \nSing 2 is written and directed by acclaimed returning filmmaker Garth Jennings.\n \n#Halsey #SING2 #Porsha #CouldHaveBeenMe",
